import styled from "styled-components";

export const HamburguerMenu = styled.button`
position: absolute;
width: 1rem;
aspect-ratio: 1;
top: 2rem;
right: 2rem;
background-color: red;
z-index: 9999;

span{
    display: block;
    position: relative;
}

`
